import React from "react";
import { useParams } from 'react-router-dom';
import Navbar from "../../components/navbar";
import GoTDatas from "../../datas/hod.json"

const Catalogo = () => {
  const { id } = useParams();
  return (
    <>
      <Navbar />
      <p>Catalogo {id}</p>
      <a target={'_blank'} rel="noreferrer" href="https://drive.google.com/file/d/1hKsKrIRukcfdwW0wFKrFDaRvcKi3foFi/view?usp=sharing">Capitulo 1</a>
    </>
  );
};

export default Catalogo;
